        function arePointsNear(userPoint, clickPoint, m) { // credits to user:69083
        var km = m/1000;
        var ky = 40000 / 360;
        var kx = Math.cos(Math.PI * clickPoint.lat / 180.0) * ky;
        var dx = Math.abs(clickPoint.lng - userPoint.lng) * kx;
        var dy = Math.abs(clickPoint.lat - userPoint.lat) * ky;
        return Math.sqrt(dx * dx + dy * dy) <= km;
        }